import React from 'react';

class RestaurantImage extends React.Component {
  render(){
    return(
      <div class="flex bg-green-400 justify-center ">
        <img alt="Fake Image" src="http://fake.image.com"/>
      </div>
    )
  }
}

export default RestaurantImage;
